const removeComments = createCommentParser({ preset: 'javascript' });

[
	[smallBenchmark, 'small', small],
	[smallBenchmark, 'smallMixed', smallMixed],
	[smallBenchmark, 'smallNoComments', smallNoComments],
	[largeBenchmark, 'large', large],
	[largeBenchmark, 'largeMixed', largeMixed],
	[largeBenchmark, 'largeNoComments', largeNoComments],
].forEach((item) => {
	const [benchmark, name, params] = item;
	benchmark.add({
		name,
		fn() {
			removeComments(...params);
		},
	});
});

async function runBenchmark(benchmark) {
	return new Promise((resolve) => {
		benchmark
			.on('cycle', (event) => {
				console.log(String(event.target));
			})
			.on('complete', function complete() {
				console.log(`Fastest is ${this.filter('fastest').map('name')}`);
				resolve();
			})
			.run({ async: true });
	});
}

(async () => {
	await runBenchmark(smallBenchmark);
	await runBenchmark(largeBenchmark);
})();
